import React from "react";


export default function ColdStorage() {
    return (
        <div className="min-h-screen bg-indigo-50 p-8">
            <div className="max-w-4xl mx-auto bg-white rounded-2xl shadow-lg p-8">
                <h1 className="text-3xl font-bold text-indigo-600">Cold Storage Services</h1>
                <p className="mt-4 text-gray-700">Locate cold storage facilities, pricing and booking information.</p>
            </div>
        </div>
    );
};
